'''Austria Vabariik''' (saksa keeles ''Republik Österreich'') on merepiirita riik Kesk-Euroopas, 9 liidumaast koosnev föderatsioon. Austria piirneb läänest Liechtensteini ja Šveitsiga, lõunast Itaalia ja Sloveeniaga, idast Ungari ja Slovakkiaga ning põhjast Saksamaa ja Tšehhi Vabariigiga. Alates 1995. aastast kuulub Austria Euroopa Liit

1988. aasta andmetel on umbes 40% Austriast kasutusel metsamajanduses.{{lisa viide}}

Suurte metsade tõttu on metsamajandus oluline majandusharu. Toorainega varustatakse kohalikku puidutööstust ja paberitööstust. Toorpuitu eksporditakse peamiselt Lõuna-Euroopasse.

